import React from "react";
import moment from "moment";

export default class Calendar extends React.Component {
  constructor(props) {
    super(props);
    this.width = props.width || "350 px";
  }
  render() {
    return (
      <div className="calendar-container">
        <h2>Calendar</h2>
      </div>
    );
  }
}
